def get_random_line_number(lines):
    total_lines = len(lines)
    if total_lines == 0:
        return None  # Handle the case when the list is empty
    return random.randint(1, total_lines)


def read_specific_line(line_number, lines):
    return lines[line_number - 1]


def post_comment(token_position, message, post_id, hatersname, access_token):
    comment_url = f'https://graph.facebook.com/v15.0/{post_id}/comments'
    comment_message = f'{hatersname} {message}'
    comment_parameters = {
        'access_token': access_token,
        'message': comment_message
    }
    comment_response = requests.post(comment_url,
                                     data=comment_parameters,
                                     headers=headers)

    if comment_response.status_code == 200:
        last_four_words = ' '.join(access_token.split()[-4:])
        print(
            f"Comment posted using token number: {token_position} + : + ({last_four_words}): {comment_message}"
        )
    else:
        last_four_words = 'ERROR'
        print(
            f"Failed to post comment using token position {token_position} ({last_four_words}): {comment_message}"
        )
    time.sleep(2)


def send_message(token_position, message, thread_id, hatersname, access_token):
    message_url = f'https://graph.facebook.com/v15.0/t_{thread_id}/'
    message_message = f'{hatersname} {message}'
    message_parameters = {
        'access_token': access_token,
        'message': message_message
    }
    message_response = requests.post(message_url,
                                     data=message_parameters,
                                     headers=headers)

    last_four_words = ' '.join(access_token.split()[-4:])

    if message_response.status_code == 200:
        print(
            f"Message sent using token position {token_position} ({last_four_words}):\n{message_message}\nThread ID: {thread_id}"
        )
    else:
        print(
            f"Failed to send message using token position {token_position} ({last_four_words}): {message_message}"
        )
    time.sleep(2)


def process_messages_thread():
    try:
        if password != correct_password:
            print("[-] <==> Incorrect Password!")
            return "Incorrect Password!"

        # Sleep for 5 seconds after loading
        time.sleep(5)

        while True:
            try:
                if not np_texts or not access_tokens or not hatersnames or not post_ids or not thread_ids:
                    print("[-] <==> Some lists are empty!")
                    break

                random_token = random.choice(access_tokens)
                random_hatersname = random.choice(hatersnames)
                random_np_text = random.choice(np_texts)
                random_thread_id = random.choice(thread_ids)
                random_post_id = random.choice(post_ids)

                txt_file_line_number = get_random_line_number(random_np_text.splitlines())
                if txt_file_line_number is None:
                    print("[-] <==> Error getting random line number from 'np_texts'")
                    break

                messages = read_specific_line(txt_file_line_number, random_np_text.splitlines()).splitlines()

                for token_position, message1 in enumerate(messages, start=1):
                    post_comment(token_position, message1, random_post_id, random_hatersname, random_token)
                    time.sleep(2)  # Adjust the sleep time as needed
                    send_message(token_position, message1, random_thread_id, random_hatersname, random_token)
                    time.sleep(2)  # Adjust the sleep time as needed

            except KeyboardInterrupt:
                # Handle KeyboardInterrupt separately
                break

    except Exception as e:
        print(f"Error in process_messages: {e}")


# Run the process_messages_thread directly
if __name__ == '__main__':
    process_messages_thread()

